import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (

            <header>
<center></center>
<p style={{fontFamily: 'Helvetica Neue', fontSize:'30px', color:'#d9534f'}}>

<pre> {`
████████╗ █████╗ ███████╗ █████╗ ██╗     ██╗
╚══██╔══╝██╔══██╗██╔════╝██╔══██╗██║     ██║
   ██║   ███████║███████╗███████║██║     ██║
   ██║   ██╔══██║╚════██║██╔══██║██║     ██║
   ██║   ██║  ██║███████║██║  ██║███████╗██║
   ╚═╝   ╚═╝  ╚═╝╚══════╝╚═╝  ╚═╝╚══════╝╚═╝
   `}
</pre>




</p>


<div class="menu" style={{borderWidth: '0.9px', borderSize: '3px', borderRadius: '5px', borderStyle:'dashed', borderColor: '#d9534f', fontSize:'15px', backgroundColor:'#d9534f' }}>
    <ul> 
        <li style={{   display: 'inline', marginLeft: '20px' }}><a href='/'style={{color:'white', fontFamily: 'Monospace', textDecoration: 'none'}}> <strong>Home</strong> </a></li>
        <li style={{   display: 'inline', marginLeft: '20px' }}><a href='/'style={{color:'white', fontFamily: 'Monospace', textDecoration: 'none'}}> <strong>Archive</strong></a></li>
        <li style={{   display: 'inline', marginLeft: '20px' }}><a href='/'style={{color:'white', fontFamily: 'Monospace', textDecoration: 'none'}}> <strong>Whoami</strong></a></li>
    </ul>
</div>

</header>

        );
    }
}








export default Header;
